Deadpool;Wade Wilson, un ancien militaire des forces spéciales, est devenu mercenaire. Après avoir subi une expérimentation hors-norme qui va accélérer ses pouvoirs de guérison, il va devenir Deadpool. Armé de ses nouvelles capacités et d'un humour noir survolté, il va traquer l'homme qui a bien failli anéantir sa vie.;2016;Fantasy, science-fiction;Tim Miller;http://fr.web.img3.acsta.net/r_1280_720/pictures/16/01/19/16/49/249124.jpg;;;;;;;
Her;En 2025 à Los Angeles, Theodore travaille pour un site web comme écrivain public, rédigeant des lettres manuscrites de toutes sortes - familiales, amoureuses, etc. - pour d'autres. Son épouse Catherine et lui ont rompu depuis bientôt un an mais il ne se décide pas à signer les papiers du divorce. Dans un état de dépression qui perdure, il installe un nouveau système d'exploitation OS1, auquel il donne une voix féminine.;2013;Drame, amour;Spike Jonze;http://fr.web.img5.acsta.net/pictures/14/03/10/10/26/014107.jpg;;;;;;;
La Cité de la Peur;Odile Deray, attachée de presse, vient au Festival de Cannes pour présenter le film `Red is Dead'. Malheureusement, celui-ci est d'une telle faiblesse que personne ne souhaite en faire l'écho. Cependant, lorsque les projectionnistes du long-métrage en question meurent chacun leur tour dans d'étranges circonstances, `Red is dead' bénéficie d'une incroyable publicité. Serge Karamazov est alors chargé de protéger le nouveau projectionniste du film.;1994;Comédie;Alain Berberian;http://fr.web.img6.acsta.net/medias/nmedia/18/35/86/35/19106159.jpg;;;;;;;
L'Insoutenable Légèreté de l'être ;L'Insoutenable légèreté de l'être traite de plusieurs thèmes, et place, au centre de tout, des personnages incarnant de grandes idées. Parmi eux, Tomas oscille entre le libertin et l'amoureux passionné, alors que Tereza brigue l'amour pur et que Sabina poursuit la légèreté.;1988;Drame;Philip Kaufman;http://es.web.img3.acsta.net/c_215_290/pictures/210/033/21003334_20130505192936204.jpg;;;;;;;
Cinema Paradiso;À Rome, à la fin des années 1980, Salvatore vient d'apprendre la mort de son vieil ami Alfredo. Par cette nouvelle, c'est toute son enfance qui remonte à la surface : son village natal, en Sicile, quand on l'appelait Totò et qu'il partageait son temps libre entre l'église (où il était enfant de chœur) et la salle de cinéma paroissiale, où régnait Alfredo, le projectionniste qui, au travers des films qu'il projetait, lui apprenait la vie;1988;Drame;Giuseppe Tornatore;http://www.lavanguardia.com/r/GODO/LV/p4/WebSite/2018/01/11/Recortada/img_astrid_20180111-171906_imagenes_lv_terceros_toto-k7kE-U434221767790sIB-992x558@LaVanguardia-Web.jpg;;;;;;;
Le Tombeau des lucioles;Durant l'été 1945, dans le Japon de la Seconde Guerre mondiale, deux enfants, Seita (un adolescent de quatorze ans) et sa jeune sœur Setsuko (qui a quatre ans), se trouvent livrés à eux-mêmes après la mort de leur mère, à la suite du bombardement à la bombe incendiaire de Kobe par les forces armées américaines. Après avoir vainement tenté de contacter leur père, un officier supérieur de la marine impériale japonaise, Seita et Setsuko partent habiter chez une tante éloignée. Un temps accueillante, la tante traite progressivement les deux enfants comme des fardeaux. Aussi, Seita et Setsuko partent et se réfugient dans un abri désaffecté. Celui-ci est illuminé la nuit par des milliers de lucioles. Les problèmes s'enchaînent : la nourriture vient à manquer et Setsuko est victime d'anémie. Seita se met alors à voler de la nourriture, mais se fait prendre par un fermier. En désespoir de cause, il part en ville vider le compte en banque de ses parents et apprend à l'occasion la capitulation du Japon et la destruction de la marine japonaise. De retour à l'abri avec de la nourriture, il ne parvient pas à sauver Setsuko d'une mort lente et atroce. Après l'avoir incinérée et mis ses cendres dans la boîte à bonbon que Seita avait offerte à Setsuko juste avant de quitter leur maison, et qui fut le rare plaisir culinaire de Setsuko durant leurs mésaventures, il se laisse à son tour dépérir jusqu'à sa mort dans une gare, dépeinte au début du film avant un long flash-back. Les esprits des deux enfants, réunis, contemplent le Kobe moderne.;1988;Drame;Isao Takahata;data:image/jpeg;base64
